import Link from 'next/link'
import React from 'react'
import {Layout, Menu} from 'antd'
import {
    UserOutlined,
    MenuOutlined,

} from '@ant-design/icons'

const {Header} = Layout
const {SubMenu} = Menu

class HomePage extends React.Component {
    render(){
    return(
        <Layout>
            <Header>
            <Menu mode = 'horizontal'>
                <Menu.Item key = '1'>
                    <Button>
                        <MenuOutlined style={{fontSize: '30px'}}/>
                    </Button>
                </Menu.Item>
                <Menu.Item key = '2' style={styles.title}>
                    <Link href = '/home'>
                        <a>UltiNote</a>
                    </Link>
                </Menu.Item>
                <Menu.Item key = '3' style={styles.pfp}>
                    <Link href = '/home'>
                        <a><UserOutlined style={{fontSize: '30px'}}/></a>
                    </Link>
                </Menu.Item>
            </Menu>           
            </Header> 
        </Layout>  
    )
    }
}

export default HomePage

const styles = {
    nav: {

    },
    sideBar: {

    },
    title: {
        fontFamily: 'verdana', 
        fontSize: '24px',
    },
    pfp: {
        float: 'right', 
    },
}
